import React, {Component} from 'react'
import ReactDOM from 'react-dom'
import './React.css'
import FilteredList from './FilteredList.js'

import {Paper, Card} from '@material-ui/core'
import 'bootstrap/dist/css/bootstrap.min.css'

const productList = [
 { name: "Cute Plant", size: "Medium", mood: "Happy", price: "$1.99"},
 { name: "Happy Plant", size: "Large", mood: "Happy", price: "$1.99"},
 { name: "Sad Plant", size: "Desktop", mood: "Sad", price: "$2.99"},
 { name: "Smart Plant", size: "Medium", mood: "Sad", price: "$2.99"},
 { name: "Sleepy Plant", size: "Desktop", mood: "Angry", price: "$3.99"}
]

class App extends Component {
  render() {
    return(
      <div>
      <h1>Title</h1>

        <FilteredList list={productList}/>

      </div>
    )
  }
}

ReactDOM.render(<App />, document.getElementById("root"))
